import React from 'react';
import logo from './logo.svg';
import './App.css';

export function App() {
  const listChallenges = fetch('/api/challenges/names')
  return (
    <div className="App">
      <header className="App-header">
        Results rezalgo
      </header>
      <div className="flex">
        <div>
          list : {listChallenges}
        </div>
        <div>
          infos
        </div>
      </div>
    </div>
  );
}

export default App;
